import React, { useEffect, useState } from 'react'
import {useParams } from 'react-router-dom'
import { useDispatch, useSelector } from 'react-redux'


import { modelImage } from '../actions/productActions'


function AiModelScreen() {  

  const params = useParams();
  const dispatch = useDispatch();

  const imageData = useSelector(state => state.imageData);
  const { image } = imageData;
  const [text, setText] = useState("");

 

  const runModel = () => {
    console.log(text)
    useEffect(() => {
      dispatch(modelImage(`${text}`))  
    }, [dispatch, params])

    console.log(image["encoded_image"])
  }

 


  return (
    <div>
      <h1> Stable Diffusion Model</h1>
      <form onSubmit={handleSubmit}>
        <label>Enter your name:
          <input 
            type="text" 
            value={text}
            onChange={(e) => setText(e.target.value)}
          />
        </label>
        <input type="submit" onSubmit={() => runModel()}/>
        </form>
      <img src={`data:image/jpeg;base64,${image["encoded_image"]}`} />
    </div>
  )
}

export default AiModelScreen
